import Footer from './../components/nav/Footer';

const Home = () => {
    return (
        <div>
                <React.Fragment>
                <Navbar />

                <Header2 content={null} />

                <HowItWorks content={null} />

                <Footer/>
            </React.Fragment>
        </div>
    )
}

export default Home
